import { isNull } from "@tsparticles/engine";
export class ImageMask {
    constructor() {
        this.src = "";
    }
    load(data) {
        if (isNull(data)) {
            return;
        }
        if (data.src !== undefined) {
            this.src = data.src;
        }
    }
}
